            }
        };

        var applySdkPathsOverrides = function(clientData) {
            var originalPaths = $allConfigs.sdk.extraProperties.paths;
            var sdkOverrides = clientData.sdk;
            if(sdkOverrides && sdkOverrides.server) {
                originalPaths.server = clientData.sdk.server;
            }
        };

        var getFilesPaths = function() {
            var clientData = getClientData();
            if(clientData) {
                applySdkPathsOverrides(clientData);
                applyOrbitPathsOverrides(clientData);
            }
            return {
                sdk: $allConfigs.sdk.extraProperties.paths,
                orbit: $allConfigs.orbit.extraProperties.paths
            };
        };

        var loadScriptTag = function(id, url) {
            var scriptTag = document.createElement('script');
            scriptTag.id = id;
            scriptTag.src = url;
            document.head.appendChild(scriptTag);
        };

        var loadStyleTag = function(id, url) {
            var styleTag = document.createElement('link');
            styleTag.id = id;
            styleTag['href'] = url;
            styleTag['rel'] = 'stylesheet';
            styleTag['type'] = 'text/css';
            styleTag.onerror = function(err) {
                console.error('Failed to download CSS from ' + url, err);
                if(0 < url.indexOf('/configurations/')) {
                    document.head.removeChild(styleTag);
                    loadStyleTag(id, url.replace('/configurations/', '/configs/'));
                }
            };

            document.head.appendChild(styleTag);
        };

        var loadAppFiles = function() {
            var filesPaths = getFilesPaths();
            loadScriptTag('cgp_loader', filesPaths.sdk.server + filesPaths.sdk.js);
            loadScriptTag('orbit_loader', filesPaths.orbit.server + filesPaths.orbit.js);
            loadStyleTag('orbit_loader_style', filesPaths.orbit.server + filesPaths.orbit.css);
            if(filesPaths.orbit.brandCSSFallback) {
                loadStyleTag('orbit_loader_brand_style_fallbakc', filesPaths.orbit.server + filesPaths.orbit.brandCSSFallback);
            }
            loadStyleTag('orbit_loader_brand_style', filesPaths.orbit.server + filesPaths.orbit.brandCSS);
            loadStyleTag('cgp_loader_style', filesPaths.sdk.server + filesPaths.sdk.css);
        };

        var logToElastic = function (eventCategory,brandID, subBrandID) {

            try {

                fetch($allConfigs.sdk.config.StructuredLogging.storageUrl, {
                    method: 'POST',
                    mode: 'cors',
                    cache: 'no-cache',
                    credentials: 'same-origin',
                    headers: {
                        'Content-Type': 'application/json'

                    },
                    redirect: 'follow',
                    referrer: 'no-referrer',
                    body: JSON.stringify({
                        "eventData": {
                            "event": "CGP_GENERIC_EVENT",
                            "CGPEventCategory": "[Technical-event]",
                            "CGPEventAction": eventCategory,
                            "CGPEventValue": "brandID:" + brandID +" subBrandID:" + subBrandID
                        },
                        "eventHeader": {
                            "level": "information",
                            "target": "casino-orbit"
                        }
                    })
                });

            } catch (e) {
                console.error('ERROR WHEN LOGGING ORBIT FALLBACK TO KIBANA FROM INDEX HTML');
            }
        };

        if(isUnsupportedBrowser()){
            return;
        }

        //for PWA we don't want splash screen
        if (!isProgressiveWebApp()) {
            showOrbitSplash();
        }

        loadClientDataFromUrl();
        loadAppFiles();
    })();

</script>
